import React, {useState} from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  let [title, titleSet] = useState(['test1', 'test2', 'test3']);
  let [articles, articlesSet] = useState(['testArticle1', 'testArticle2', 'testArticle3']);
  let [dateTime, dateTimeSet] = useState(['2020/12/25 00:00:00', '2020/12/26 00:00:00', '2020/12/27 00:00:00']);

  return (
    <div className="App">
      <div className="header-nav">
        <div>Playneko의 블로그</div>
      </div>
      <div className="lists">
        <h3>{ title }</h3>
        <p>{ articles }</p>
        <p>{ dateTime }</p>
        <hr />
      </div>
    </div>
  );
}

export default App;
